import React, { useState, useEffect } from "react";
import Session from "react-session-api";
import "./MainWindow.css";
import UserStore from "../stores/UserStore";
import { Login } from "./Login";
import { Registration } from "./Registration";
import { BottomNavigationAction } from "@material-ui/core";

export const MainWindow = ({ onRegistration }) => {
  const [loggedIn, setLoggedIn] = useState(false);

  useEffect(() => {
    setLoggedIn(Session.get("isLoggedIn"));
  }, sessionStorage);

  return (
    <div>
      {!loggedIn ? <Registration onRegistration={onRegistration} /> : "logged"}

      <BottomNavigation
        value={value}
        onChange={(event, newValue) => {
          setValue(newValue);
        }}
        showLabels
        className={classes.root}
      >
        <BottomNavigationAction label="Books" icon={<RestoreIcon />} />
        <BottomNavigationAction label="Login" icon={<Login />} />
        <BottomNavigationAction label="Register" icon={<Register />} />
      </BottomNavigation>
    </div>
  );
};
